import React from "react";

function Home() {
  return (
    <div className="home">
      <h1>¡Bienvenido a Co'ox Travel!</h1>
      <p>Tu plataforma para planear viajes, reservar experiencias y descubrir promociones únicas.</p>
      <img src="https://images.unsplash.com/photo-1465156799763-2c087c332922?auto=format&fit=crop&w=800&q=80" alt="Travel" className="banner-img"/>
    </div>
  );
}

export default Home;
